import "./Skills.css";
import { FaReact, FaNodeJs, FaJava } from "react-icons/fa";
import {
  SiJavascript,
  SiPython,
  SiMysql,
  SiPostgresql,
  SiGit,
} from "react-icons/si";

const skills = [
  { name: "Java", percent: 90, icon: <FaJava /> },
  { name: "Python", percent: 85, icon: <SiPython /> },
  { name: "JavaScript", percent: 88, icon: <SiJavascript /> },

  { name: "Node.js", percent: 85, icon: <FaNodeJs /> },
  { name: "React.js", percent: 80, icon: <FaReact /> },
  { name: "MySQL", percent: 90, icon: <SiMysql /> },

  { name: "PostgreSQL", percent: 85, icon: <SiPostgresql /> },
  { name: "Git", percent: 88, icon: <SiGit /> },
  { name: "REST APIs", percent: 92, icon: <SiGit /> }
];

export default function Skills() {
  return (
    <section className="skills-section">
      <h2 className="skills-title">Skills & Technologies</h2>
      <p className="skills-subtitle">
        The tools and technologies I use to bring ideas to life
      </p>

      <div className="skills-grid">
        {skills.map((skill, index) => (
          <div className="skill-card" key={index}>
            <div className="skill-top">
              <div className="skill-left">
                <span className="skill-icon">{skill.icon}</span>
                <span className="skill-name">{skill.name}</span>
              </div>
              <span className="skill-percent">{skill.percent}%</span>
            </div>

            <div className="skill-bar">
              <div
                className="skill-fill"
                style={{ width: `${skill.percent}%` }}
              ></div>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
}
